        return np.asarray(img, np.uint16) * 256

    return img

def to_pil(*images):
    images = [Image.fromarray((image).astype(np.uint8)) for image in images]
    if len(images) == 1:
        return images[0]
    else:
        return images

def to_gray(img):
    gray = cv2.cvtColor(img, cv2.COLOR_RGB2GRAY)
    return cv2.cvtColor(gray, cv2.COLOR_GRAY2RGB)

def pil_image_to_ndarray(pil_image, grayscale, num_channels):
    ret = convert_pil(pil_image, grayscale, num_channels)
    return np.asarray(ret, dtype=np.uint8)

def upscale_float_image(img, as_uint16):
    if as_uint16:
        return np.asarray((img * 65535), np.uint16)

    return np.asarray((img * 255), np.uint8)

