def _parse_url(url_string):
        u = urlparse(url_string)
        url = u.path
        query = parse_qs(u.query)

        return {
            'full_url': url_string.strip(),
            'url': url.strip(),
            'query': query
        }

def urlencode(query):
    """Encode string to be used in urls (percent encoding).

    :param query: string to be encoded
    :type query: str
    :return: urlencoded string
    :rtype: str

    :Example:
        >>> urlencode('pekná líščička')
        'pekn%C3%A1%20l%C3%AD%C5%A1%C4%8Di%C4%8Dka'
    """
    if hasattr(urllib, 'parse'):
        return urllib.parse.urlencode(query)
    else:
        return urllib.urlencode(query)

def get_query(url):
        parsed = urlparse(url)
        parameters = parse_qs(parsed.query)
        if 'q' in parameters:
            return ''.join(parameters['q'])
        return None

